Information
------------------------------

In the aftermath of World War II, the Soviet Union and America helped themselves to a treasure trove of Nazi technology. Out of these spoils came two very similar jets--the MiG 15 and the F-86. But the MiG came first, and its effectiveness shocked the unsuspecting West and threatened to turn the tide of the undeclared air war over the Cold War battleground of Korea. MiG-15: RUSSIAN STEALTH reveals how the Soviets combined domestic ingenuity and &quot;borrowed&quot; European technology to produce this legendary fighter. Veterans of the very first jet versus jet dogfights reveal what it was like to fly the MiG in combat conditions, while Soviet archival film documents these once-secret engagements. Travel back to the dawn of the jet age for a fascinating look at the plane that panicked the West. 

-- All DVD Extras joined to the film --

